import React from 'react';
import './Home.scss';
import Carousel from 'react-bootstrap/Carousel'

const Home = () => {
    return (
        <div className="home">
            <Carousel>
                <Carousel.Item>
                    <img
                        className="d-block w-100"
                        src="https://i.ibb.co/mG3RTn7/400-Pngdpi-Logo.png"
                        alt="First slide"
                    />
                </Carousel.Item>
            </Carousel>
        </div>
    );
};

export default Home;
